import { useSelector, useDispatch } from 'react-redux'
import React, { Component } from 'react';
import { Link } from 'react-router-dom';

const Test = () => {
  const username = useSelector(state=> state.user.username)
  const dispatch = useDispatch();

  const handleClick = () => {
    dispatch({
      type: "updateUsername",
      username: "hyy"
    })
  }
  return (
    <React.Fragment>      <div>{username}</div>
      <Link className="nav-link active" to="/myspace/test2"><button onClick={handleClick}>+</button></Link>
    </React.Fragment>
    
  );
}
 
export default Test
